import "../App.css";
import { Collapse, Divider, List, Input, Checkbox } from "antd";
import React, { Component } from "react";
import importJSON from "../data/questionsDict.json";
console.log(importJSON);
const Fb = importJSON.fb;
const { Panel } = Collapse;
const text = `
  A dog is a type of domesticated animal.
  Known for its loyalty and faithfulness,
  it can be found as a welcome guest in many households across the world.
`;
const categories = Fb.map((cat, catIndex) => cat.name);

function Checklist() {
  return (
    <div className="panels">
      {/* {Fb.map((categories, catIndex) => {
        return (
          <Collapse>
            <Panel header="Hello">
              <div catIndex={catIndex}>{categories.name}</div>
            </Panel>
          </Collapse>
        );
      })} */}
      {}
      <Collapse defaultActiveKey={["1"]}>
        <Panel header="This is panel header 1" key="1">
          <p>{text}</p>
        </Panel>
        <Panel header="This is panel header 2" key="2">
          <p>{text}</p>
        </Panel>
        <Panel header="This is panel header 3" key="3">
          <p>{text}</p>
        </Panel>
      </Collapse>
    </div>
  );
}

export default Checklist;
